INSERT INTO `topics` (`id`, `name`, `description`, `category`) VALUES
(1,	'General Discussion',	'This is the place for conversation about all things MADBLOX. Posts not pertaining to MADBLOX will be mercilessly pruned by our crack squad of moderators.',	1),
(2,	'Creations Gallery',	'Discuss your MADBLOX creations and share the secrets of your success. Post requests for help building and scripting here.',	1),
(3,	'Suggestions, Feedback, and Ideas',	'Do you have a suggestion for how to make MADBLOX better? Share your feedback here.',	1),
(4,	'Off Topic',	'Feel like talking about stuff other than MADBLOX? Post here.',	1),
(5,	'MADBLOX Testing',	'This is the place to talk about the exciting stuff going on with the MADBLOX \r\nTest servers. Official news about testing will be posted here. All topics about the Test servers belong in this forum. [Note: Test servers will not be up all the time. Up times will be announced.]',	9999999),
(6,	'Building Help',	'Learn the ins and outs of building structures in MADBLOX here! Share your techniques with other builders, discuss designs, and draft plans.',	2),
(7,	'Scripting Help',	'Need help with a script you are writing? Need to edit an existing script? Want to share your devious programming skills? For advanced MADBLOX users.',	2),
(8,	'Technical Problems and Bug Reports',	'Are you having trouble installing or upgrading MADBLOX\r\n? Account troubles? Website problems? Have you found a bug? Post here!',	2),
(9,	'Role-Playing',	'Does your MLGbloxian want to fly to the moon? Command a ship? Lay siege to a castle? Start a role-playing thread here.',	3),
(10,	'MADBLOXiwood',	'The forum for movie-makers!',	3),
(11,	'Rate My MADBloxian',	'Show the world of MADBLOX your character. Get feedback on your outfit.',	3),
(12,	'Sports',	'Show off your MADBLOX athlete. Or just hang out with other MADBLOX fans.',	4),
(13,	'Music',	'Does your MLGBloxian rock? Let people know. Or just talk about your favorite bands.',	4),
(14,	'Movies/TV/Books',	'Does your MLGBloxian belong on the silver screen, or in the pages of a novel? Show off your MADBLOX movie star, discuss your favorite TV series, films, and the books you love.',	4),
(15,	'Request Hats/Retextures',	'Request any hats or items that you want uploaded to the catalog.',	5);
